import React from 'react';



function Change() {

    const chnageImg = "";
    const curDate = new Date();
    curDate = curDate.getHours();



    if (curDate >= 1 && curDate < 12) {

        chnageImg = "Hi";

    } else if (curDate >= 12 && curDate < 19) {

        chnageImg = "Hellow";
    } else {

        chnageImg = "better";
    }


    return (

        <React.Fragment>
            <span>{chnageImg}</span>
        </React.Fragment>
        
        
        );

}

export default Change;
